import axios from "axios";
const REST_API_BASE_URL = 'http://localhost:8080/';

export const listManagers = () => {
    return api.get(REST_API_BASE_URL + "api/admin/getAllManagers",{ withCredentials: true } );
}

export const listEmployees = () => {
    return axios.get(REST_API_BASE_URL + "api/admin/getEmployees",{ withCredentials: true } );
}

export const listEmployeesLeaveRequests = () => {
    return axios.get(REST_API_BASE_URL + "api/admin/getEmployeeLeaveRequestsReport",{ withCredentials: true } );
}

export const listEmployeesExitRequests = () => {
    return axios.get(REST_API_BASE_URL + "api/admin/getEmployeeExitRequestsReport",{ withCredentials: true } );
}

export const getuserDetails = (email) => {
    return axios.get(`${REST_API_BASE_URL}api/admin/getuserDetails?email=${email}`,{ withCredentials: true } );
}
